import React from "react";
import "../node_modules/bootstrap/dist/css/bootstrap.min.css";

const KeepNote = () => {
  return (
    <>
    <section>
      <div class="mb-3">
        <input
          type="text"
          placeholder = "Title"
          class="form-control"
          id="exampleFormControlInput1"
        />
      </div>
      <div class="mb-3">
        <textarea
          class="form-control"
          id="exampleFormControlTextarea1"
          rows=""
          column = ""
          placeholder = "Save Your Note"
        ></textarea>
      </div>
      </section>
    </>
  );
};

export default KeepNote;
